      color: white;
  	}
  	.at-uploadform input.picker-input__text, input.picker-input__text{
      border: 1px solid transparent;
  	}
  	/*login*/
  	body, h1, h2, h3, h4, h5, h6 {
    	color: white;
    	font-family: Manrope,sans-serif;
	}
  	.login-page {
    	background-color: #3B3F48;
    	background-image: url(https://stardeos.com/);
	}
