    	color: white;
	}
  	.login-page .login__container .login__box {
    	background-color: #23252b;
    	border-radius: 8px;
    	--tw-shadow: 0 4px 6px -1pxrgba(0,0,0,0.1), 0 2px 4px -1px rgba(0,0,0,0.06);
    	box-shadow: var(--tw-ring-offset-shadow,0 0 #0000),var(--tw-ring-shadow,0 0 #0000),var(--tw-shadow);
	}
  	.login-page .login__container__form .form-group input {
    	border: 1px solid black;
    	background-color: black;
	}
  	/*header*/
  	.at-searchbox .form-control {
    	background-color: black !important;
      	color: white;
	}
  	.at-ratingbox {
    	background: #3B3F48;
	}
  	.at-header{
		background-color: #23252b;
		box-shadow: 0 0 0px;
    }
	.at-header-one {
    	border-bottom: 0px;
  	}
